import React, { useEffect, useState } from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import axios from "axios";
import Footer from "./Footer";
import Navbar from "./NavBar";
import MainPage from "./MainPage";
import LoginForm from "./LoginForm";
import BoardList from "./BoardList";
import DetailPage from "./DetailPage";
import CreateForm from "./CreateForm";
import UpdateForm from "./UpdateForm";
import About from "./About";

function App() {
  const [detailBoard, setDetailBoard] = useState([]);

  const getDetailBoard = (data) => {
    setDetailBoard(data);
  };

  useEffect(() => {}, []);
  return (
    <>
      <Navbar />

      <Routes>
        {/* 메인 페이지*/}
        <Route path="/" exact element={<MainPage />} />
        <Route path="/about" exact element={<About />} />
        {/* 프로젝트 모음 리스트 */}
        <Route
          path="/board/list"
          element={<BoardList getDetailBoard={getDetailBoard} />}
        />
        {/* 글 생성 폼 */}
        <Route path="/create" exact element={<CreateForm />} />
        {/* 글 상세 페이지 */}
        <Route
          path="/detail/:id"
          exact
          element={
            <DetailPage
              detailBoard={detailBoard}
              getDetailBoard={getDetailBoard}
            />
          }
        />
        {/* 글 수정 폼 */}
        <Route
          path="/update/:id"
          exact
          element={
            <UpdateForm
              detailBoard={detailBoard}
              getDetailBoard={getDetailBoard}
            />
          }
        />
        {/* 로그인 화면*/}
        <Route path="/login" exact element={<LoginForm />} />
      </Routes>
      <Footer />
    </>
  );
}

export default App;
